Storyline:

    After the Dalton brothers are killed off by lawmen, their female relatives take up where they left off, but armed with more dangerous weapons. The embark on a series of stagecoach robberies, bank hold-ups and picking up loose change here and there. The girls are Holly (Merry Anders,, the oldest and gang-leader; Rose Lisa Davis),, a cold-blooded killer; Columbine (Penny Edwards), who mostly wants out; and Marigold ('Sue George'), who mostly holds the horses. A gambler, W. T. &quot;Illinois&quot; Grey (John Russell), is on hand to bind Columbine's wounds.



